async def ssssss():
    import datetime
    import pandas as pd
    import re


    def generate_dataframe(nomenclatures):
        meta = None
        result_set = []
        for nomenclature in nomenclatures:

            if not meta:
                meta = nomenclature.keys()
            result_set.append(nomenclature.values())
        df = pd.DataFrame(data=result_set, columns=meta)
        return df


    async def connect():
        client_sbis = SbisConnection(
            clientId="1010522488867220",
            secret="ZUMMEKPTNDY4ZJ1VXTYULEWO",
            secretKey="2IwyjlXwvAOzEEvqrpZWm7BVDx3jjTlrtWvkx32x3zn3OvPbu0D2bvlLaLLhUTHApXFvhEzIZEkDSJdTGfmaZtuAVWwSTQm8avBgM1rBApbinVfdgXOnrR"
        )

        await client_sbis.authenticate()  # Выполняет аутентификацию пользователя и сохраняет полученный токен и сессионный ID (sid).
        client_sbis.data()  # Выводит данные текущего состояния клиента.
        return client_sbis


    async def get_information(client_sbis):
        points = await client_sbis.get_points(withPrices=True)  # Возвращает список точек продаж с учетом заданных параметров.

        if not points.get("salesPoints"):
            return
        point = points.get("salesPoints")[0]
        price_lists = await client_sbis.get_priceList(pointId=point["id"],
                                                actualDate=datetime.datetime.now().isoformat(sep=" ", timespec="seconds"),
                                                # actualDate="13.11.2024",
                                                # "actualDate=" + datetime.datetime.now().strftime("%d.%m.%Y")
                                                ) #'26.10.2024'  Запрос возвращает информацию о действующих прайс-листах. Чтобы запрос работал корректно, настройте прайс-лист с типом «Выбранные наименования».
        if not price_lists["priceLists"]:
            print("нет прайс листов")
            return
        first_price_list = price_lists["priceLists"][0]
        # nomenclatures = client_sbis.get_nomenclatureList(pointId=point["id"],
        #                                                  priceListId=first_price_list["id"],
        #                                                  withBalance=True,
        #                                                  pageSize=100)  # Запрос возвращает информацию о товарах и услугах по действующему прайс-листу.

        nomenclatures = get_all_nomenclatures(client_sbis, point["id"], first_price_list["id"])
        #client.logout()  # Выполняет выход пользователя из сист
        return nomenclatures


    def get_all_nomenclatures(client_sbis: SbisConnection, point_id, price_list_id, page_size: int = 100):
        total_nomenclatures = []
        page = 0
        while True:
            print(f"Loading page={page + 1}...")
            # Запрос возвращает информацию о товарах и услугах по действующему прайс-листу.
            nomenclatures = client_sbis.get_nomenclatureList(pointId=point_id,
                                                        priceListId=price_list_id,
                                                        withBalance=True,
                                                        pageSize=page_size,
                                                        page=page)
            if not nomenclatures["nomenclatures"]:
                break
            total_nomenclatures.extend(nomenclatures["nomenclatures"])
            if not nomenclatures["outcome"]["hasMore"]:
                break
            page += 1
            print(f"Loaded page={page + 1}, count = {len(total_nomenclatures)}")
        # generate_dataframe(nomenclatures["nomenclatures"])
        print(f"All nomenclatures loaded pages={page + 1}, count = {len(total_nomenclatures)}")
        client_sbis.logout()  # Выполняет выход пользователя из сист
        return total_nomenclatures

    def create_measure(row):
        measure = re.findall(r'\d+\*\d+\*\d+,\d', row)
        if measure:
            return measure[0]
        measure = re.findall(r'\d+\*\d\(+\d+\)+\*\d+,\d', row)
        if measure:
            return measure[0]
        return row

    async def get_table():
        client = await connect()
        nomenclatures = await get_information(client)
        df_main = generate_dataframe(nomenclatures)

        df = df_main.copy(deep=True)
        df = df.drop(['accountingSubType', 'article', 'attributes', 'description', 'modifiers', 'short_code'], axis=1)

        df_parents = df[df["isParent"]==True]
        df_parents = df_parents.drop(['balance', 'cost', 'description_simple', 'externalId', 'hierarchicalParent', 'id', 'images', 'isKit', 'isParent', 'nomNumber', 'unit'], axis=1)

        df_childs = df[df["isParent"].isin([False, None])]
        df_childs = df_childs.drop(['isKit', 'isParent',], axis=1)   

        df_childs["category"] = df_childs['hierarchicalParent'].map(lambda x: df_parents[df_parents['hierarchicalId'] == x]['name'].values[0] )
        
        df_childs['balance'] = df_childs['balance'].astype(int)

        df_childs['type'] = df_childs['name'].map(lambda x: x.split("\"")[-2])

        df_childs['measure'] = df_childs['name'].map(create_measure)

        df_childs = df_childs.sort_values(by=['hierarchicalParent', 'measure', 'type'])

        mi = pd.MultiIndex.from_arrays([df_childs['category'], df_childs['measure'],df_childs['type']], names=['Вид', 'Размеры', 'Тип'])

        df_childs['Кол-во'] = df_childs['balance'].astype(str) + ' ' + df_childs['unit'] 
        df_childs['Цена'] = df_childs['cost'].map(lambda x: '-' if pd.isna(x)  else str(x) + ' ₽')
        df_childs['Название'] = df_childs['name']
        df_childs['Доп. инфо'] = df_childs['description_simple'].map(lambda x: '' if x is None else x)
        
        result = df_childs[['Кол-во','Цена','Доп. инфо','Название']].set_index(mi)

        return result.to_html()
    return await get_table()

class SbisConnection(SbisClient):
    async def authenticate(self):
        """
        Выполняет аутентификацию пользователя и сохраняет полученный токен и сессионный ID (sid).

        Raises:
            Exception: Если произошла ошибка при выполнении запроса.

        """
        json_payload = {
            "app_client_id": self.clientId,
            "app_secret": self.secret,
            "secret_key": self.secretKey
        }
        url = 'https://online.sbis.ru/oauth/service/'
        headers = {"Content-Type": "application/json"}
        print(json.dumps(json_payload))
        print(headers)
        try:
            response = await pyfetch(url=url, method="POST", body=json.dumps(json_payload), headers=headers)
            if response.status == 200:
                data = await response.json()
                self.token = data.get('token')
                self.sid = data.get('sid')
                print("Аутентификация прошла успешно.")
            else:
                print(f"Ошибка при аутентификации. Код ответа: {response.status}")
        except Exception as e:
            print(f"Ошибка при выполнении запроса: {str(e)}")

    def data(self):
        """
        Выводит данные текущего состояния клиента.
        """
        print(f"\nClient ID: {self.clientId}")
        print(f"Secret: {self.secret}")
        print(f"Secret Key: {self.secretKey}")
        print(f"Token: {self.token}")
        print(f"Session ID (SID): {self.sid}\n")

    async def logout(self):
        """
        Выполняет выход пользователя из системы, завершая использование текущего токена доступа.

        Raises:
            Exception: Если произошла ошибка при выполнении запроса.

        """
        if not self.token:
            print("Не выполнена аутентификация. Вызовите метод authenticate() для получения токена.")
            return
        
        url = 'https://online.sbis.ru/oauth/service/'
        json_payload = {
            "event": "exit",
            "token": self.token
        }
        headers = {
            'Content-Type': 'application/json'
        }
        
        response = await pyfetch(url, method="POST", body=json_payload, headers=headers)
        if response.status >= 400: # Проверка на ошибки HTTP
            print(f"Ошибка при выполнении запроса: {str(response)}")
        else:
            print("Выход из системы выполнен успешно.")
            


    async def get_points(self, *, pointId: int=None, product: str=None, withPhones: bool=None, withPrices: bool=None, withSchedule: bool=None, page: int=None, pageSize: int=None):
        """
        Запрос возвращает информацию о точках продаж.

        Parameters:
            pointId (int, optional): Идентификатор точки продаж.
            product (str, optional): Название продукта точки продаж.
            withPhones (bool, optional): Флаг передачи всех или одного номера телефона по точке продаж. По умолчанию False.
            withPrices (bool, optional): Флаг передачи идентификаторов всех прайсов по точке продаж. По умолчанию False.
            withSchedule (bool, optional): Флаг передачи подробного режима работы точки продаж. По умолчанию False.
            page (int, optional): Номер страницы результата. Если не указан, вернутся все результаты.
            pageSize (int, optional): Размер страницы. Если не указан, вернутся все результаты.

        Returns:
            dict: Список точек продаж в формате JSON.

        Raises:
            Exception: Если произошла ошибка при выполнении запроса.

        """
        url = 'https://api.sbis.ru/retail/point/list'
        headers = {
            "X-SBISAccessToken": self.token
        }
        parameters = {
            'pointId': pointId,
            'product': product,
            'withPhones': withPhones,
            'withPrices': withPrices, 
            'withSchedule': withSchedule,
            'page': page,
            'pageSize': pageSize
        }

        parameters = {k: v for k, v in parameters.items() if v is not None}
        url = url + '?' + '&'.join(f'{key}={value}' for key, value in parameters.items())
        print(url)
        print(headers)
        response = await pyfetch(url, method="GET", headers=headers, mode='no-cors')
        #response.raise_for_status()
        if response.status >= 400:
            raise Exception(f"Ошибка при выполнении запроса: {str(response)}")
        return await response.json()
        
        
    async def get_priceList(self, *, pointId: int, actualDate: str, searchString: str = None, page: int=None, pageSize: int=None):
        """
        Запрос возвращает информацию о действующих прайс-листах. Чтобы запрос работал корректно, настройте прайс-лист с типом «Выбранные наименования».

        Parameters:
            pointId (int): Идентификатор точки продаж, который возвращается в результате запроса «Получить точку продаж».
            actualDate (str): Дата в формате ГГГГ-ММ-ДД.
            searchString (str, optional): Название прайса, который требуется найти.
            page (int, optional): Номер страницы результата. Если не указан, вернутся все результаты.
            pageSize (int, optional): Количество записей на странице. Если не указан, вернутся все результаты.

        Returns:
            dict: Прайс-лист товаров в формате JSON.

        Raises:
            Exception: Если произошла ошибка при выполнении запроса.

        """
        url = 'https://api.sbis.ru/retail/nomenclature/price-list'
        headers = {
            "X-SBISAccessToken": self.token
        }
        parameters = {
            'pointId': pointId,
            'actualDate': actualDate,
            'searchString': searchString,
            'page': page,
            'pageSize': pageSize
        }

        parameters = {k: v for k, v in parameters.items() if v is not None}
        
        response = await pyfetch(url, method='get', params=parameters, headers=headers)
        
        if response.status >= 400:
            raise Exception(f"Ошибка при выполнении запроса: {str(response)}")
        return await response.json()
        